import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "./style.css";

const UserLogin = () => {
  const validateUserLogin = (event) => {
    // Add your validation logic here
    // Return false if validation fails
    // Return true if validation succeeds
  };

  return (
    <div>
      <div className="topnav">
        <Link to="/admin-login">Admin Login</Link>
        <Link to="/login-doctor">Doctor Login</Link>
        <Link to="/" className="home">
          <img src="https://img.icons8.com/ios/50/000000/home.png" alt="Home" />
        </Link>
      </div>
      <div className="login-container">
        <h2>User Login</h2>
        <form onSubmit={(e) => e.preventDefault() || validateUserLogin(e)}>
          <label htmlFor="username">Username:</label>
          <input type="text" id="username" name="username" required />

          <label htmlFor="password">Password:</label>
          <input type="password" id="password" name="password" required />

          <button type="submit">Login</button>
        </form>
      </div>
    </div>
  );
};

const AdminLogin = () => {
  const validateAdminLogin = (event) => {
    // Add your validation logic here
    // Return false if validation fails
    // Return true if validation succeeds
  };

  return (
    <div>
      <div className="topnav">
        <Link to="/user-login">User Login</Link>
        <Link to="/login-doctor">Doctor Login</Link>
        <Link to="/" className="home">
          <img src="https://img.icons8.com/ios/50/000000/home.png" alt="Home" />
        </Link>
      </div>
      <div className="login-container">
        <h2>Admin Login</h2>
        <form onSubmit={(e) => e.preventDefault() || validateAdminLogin(e)}>
          <label htmlFor="username">Username:</label>
          <input type="text" id="username" name="username" required />

          <label htmlFor="password">Password:</label>
          <input type="password" id="password" name="password" required />

          <button type="submit">Login</button>
        </form>
      </div>
    </div>
  );
};

const DoctorLogin = () => {
 const validateDoctorLogin = (event) => {
    // Add your validation logic here
    // Return false if validation fails
    // Return true if validation succeeds
  };  

  return (
    <div>
      <div class="topnav">
      <a href="/user-login">User Login</a>
      <a href="login-admin.html">Admin Login</a>
      <a href="index.html" class="home"
        ><img src="https://img.icons8.com/ios/50/000000/home.png" alt="Home"
      /></a>
    </div>
    <div class="login-container">
      <h2>Doctor Login</h2>
      <form action="#" method="post" onsubmit="return validateDoctorLogin()">
        <label for="username">Username:</label>
        <input type="text" id="username" name="username" required />

        <label for="password">Password:</label>
        <input type="password" id="password" name="password" required />

        <button type="submit">Login</button>
      </form>
    </div>
    </div>
  );
};


const UserRegistration = () => {
  const handleRegistration = (event) => {
    event.preventDefault();
    // Add your registration logic here
  };

  return (
    <div>
      <div className="topnav">
        <Link to="/login-doctor">Doctor Login</Link>
        <Link to="/login-admin">Admin Login</Link>
        <Link to="/" className="home">
          <img src="https://img.icons8.com/ios/50/000000/home.png" alt="Home" />
        </Link>
      </div>
      <div className="login-container">
        <h2>User Registration</h2>
        <form onSubmit={handleRegistration}>
          {/* ... rest of the form fields ... */}
          <button type="submit" id="registerButton">
            Register
          </button>
          <p className="note-asterisk">
            Note: Fields marked with{" "}
            <span style={{ fontSize: "1.2em" }}>*</span> are mandatory
          </p>
        </form>
      </div>
    </div>
  );
};

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/user-login" element={<UserLogin />} />
        <Route path="/admin-login" element={<AdminLogin />} />
        <Route path="/login-doctor" element={<DoctorLogin />} />
        <Route path="/user-registration" element={<UserRegistration />} />
        {/* Set the default route to UserLogin */}
        <Route index element={<UserLogin />} />
      </Routes>
    </Router>
  );
};

export default App;
